import React from 'react';
import DynamicFieldsForm from "../../../common/DynamicFieldsForm";
import {Row,Form, Col ,Radio, Input ,Divider} from "antd";
const { TextArea } = Input;
const style ={
  box_shadow:{
    webkitBoxShadow: "1px 3px 1px #9E9E9E",
    mozBoxShadow: "1px 3px 1px #9E9E9E",
    boxShadow: "1px 3px 1px #9E9E9E"
  }
}
class PrintPreview extends React.Component{
  constructor(props){
    super(props);
    this.state={
      pageSetting:'Page Setting',
      headerSetting:'Header',
      patientSetting:'Patient',
      footerSetting:'Footer',

      formControls:{
        abs:{
          value:'Customize Header',
        }
      }
    }
  }


  render(){

    return ( <Row>
          <Col span={12}>
            <Radio.Group defaultValue="a" buttonStyle="solid" size="small">
              <Radio.Button value="a">{this.state.pageSetting}</Radio.Button>
              <Radio.Button value="b" >{this.state.headerSetting}</Radio.Button>
              <Radio.Button value="c">{this.state.pageSetting}</Radio.Button>
              <Radio.Button value="d">{this.state.headerSetting}</Radio.Button>
            </Radio.Group>
            <div className="div_padding_top">
              <h2>{this.formControls.abs.value}</h2>

            </div>
          </Col>
          <Col span={12} >
          <div style={style.box_shadow}>
            <h3>pdf</h3>
            </div>
          </Col>


        </Row>);
  }

}
export default PrintPreview;
